func (u *TreeNodeUpsertBulk) Update(set func(*TreeNodeUpsert)) *TreeNodeUpsertBulk {
	u.create.conflict = append(u.create.conflict, sql.ResolveWith(func(update *sql.UpdateSet) {
		set(&TreeNodeUpsert{UpdateSet: update})
	}))
	return u
}

